import React from 'react';
import ReactDOM from 'react-dom/client';
import './index.css';
import App from './App';

const root = ReactDOM.createRoot(document.getElementById('root'));
root.render(
  <React.StrictMode>
    <App />
  </React.StrictMode>
);

function clock() {
  const element = (
    <div>
      <h1>Hello, world!</h1>
      <h2>Time is {new Date()}.</h2>
    </div>
  );
  root.render(element);
}
setInterval(clock, 1000);
